import React from "react";
import "./Intro.css";

import BG from "../../video-bg.mp4";
import AD from "../../AD.jpg";

const Intro = () => {
  return (
    <div class="intro">
      <img
          classname="ad"
          src={AD}
          alt="ad"
          style={{
            width: "150px",
            height: "150px",
            borderRadius: "75px",
            border: "3px solid red",
            position: "absolute"
          }}
        />
      <video autoPlay loop muted style={{ opacity: "0.3", width: "100%" }}>
        <source src={BG} type="video/mp4" />
      </video>
    </div>
  );
};

export default Intro;
